/* Historical Flanders */‘Starting around 1960 with the expansion of the Antwerp port, Flanders has always paid the bill of the vuile Sossenwaelen. Moreover, the latest decennia it has also become the OCMW of immigrants who refuse to immerse themselves in their new country of residence.’

This is a disputed political statement. ‘Vuile Sossenwaelen’ is an extreem right wing insult (Vuil = dirty) for the Frenchspeaking part of Belgium (Waelen) that allegedly all vote Socialist (Sossen).
